Star Wars: Legacy is a comic book series written by John Ostrander, primarily pencilled and co-scripted by Jan Duursema, and inked by Dan Parsons. Published by Dark Horse Comics, Legacy's first issues were released in June 2006 following Dark Horse's revamp of its Star Wars line earlier in the year.



